import React from 'react'

export default function Results(props) {
	return (
		<div>
			<h1>Results</h1>
			<div>Score is : {props.score}</div>
			<div>on {props.totalQuestions} questions</div>
			<div> in {props.totalTurns}</div>
		</div>
	)
}
